import { ValueWithRandom, isNull } from "@tsparticles/engine";
export class OrbitRotation extends ValueWithRandom {
    constructor() {
        super();
        this.value = 45;
    }
    load(data) {
        if (isNull(data)) {
            return;
        }
        super.load(data);
    }
}
